import React from 'react'
import '../App.css';
import {useNavigate } from 'react-router-dom';

function Navbar() {
    const navigate = useNavigate()

  const handleLogin = () =>{
    navigate('/Login')
  }
   const handleSignUp = () =>{
    navigate('/SignUp')
  }
    return (
        <div className="navbar">
            <div className="brand">
                <a onClick={()=>navigate('/')}><img className='logo' src="/logo192.png" alt="no-image" /></a>
                <h3>React Commerce</h3>
            </div>
            <ul className="pages">
                <li onClick={()=>navigate('/')}><a >Home</a></li>
                <li><a href="#home">Contact</a></li>
                <li onClick={()=>navigate('/About')}><a>About</a></li>
                <li><button className='btn' onClick={handleLogin}>Login</button></li>
                <li><button className='btn' onClick={handleSignUp}>Signup</button></li>
            </ul>
        </div>
    )
}

export default Navbar
